INSERT INTO `researchprop` (`res_id`, `res_title`, `res_abstract`, `res_keywords`, `res_officer`, `res_offr_gsm`, `res_offr_addr`, `res_date`, `res_detail`, `res_category`, `res_sponsor`, `res_status`, `visible`, `linkedto`, `fileno`, `res_amount`, `opentoforum`) VALUES
(1, 'Whistle Blowing', NULL, NULL, NULL, NULL, NULL, '2011-09-02', '<p>We are Growing...Higher and Higher! The founding fathers of the Economic and Financial Crimes Commission (EFCC) were convinced abinitio of the importance of training and research when they conceived the idea of a Training and Research Institute in 2005. Apart from building the Commission&rsquo;s work force of crack operatives, the Institute has been saddled with the responsibility of ensuring fifteen percent (15%) of every operative&rsquo;s time is devoted to training. All human enterprises that produce enduring results run around a robust philosophy. The training philosophy of the TRI is fulcrummed around these core values mainly: *&nbsp;Integrity *&nbsp;Courage *&nbsp;Professionalism Building these values into the sub-conscious minds of our operatives has been pursued through a gamut of training traditions, distilled and expressed as the Student Centered Problem Solving (SCPS) methodology. This methodology is itself derived from other training philosophies, ranging from Existentialism, Phenomenology; Ethnomethodology to good old African Pragmatism. Crime is basically a human activity. Like other human activity crime is situated within the context of human relationships. In our methodology, be it for investigating financial crimes like money laundering or Advanced Fee Fraud, we seek to situate the actors within the context of the relationships and linkages that they build. The key to solving crime lies in unlocking the dynamics of these human relationships. We imbue our operatives with the philosophy that crime solving lies in finding out the ways everyday relations serve criminal enterprises. God helping us, we look forward to a great year!</p>\r\n', 'Sport', NULL, 'Ongoing', 1, 1, NULL, NULL, 1),
(2, 'Investigating Ibori', NULL, NULL, NULL, NULL, NULL, '2011-09-02', 'Welcome to EFCC Academy...\r\n AYO P. OLOWONIHI \r\nCOMMANDANT We are Growingâ€¦.Higher and Higher!\r\nThe founding fathers of the Economic and Financial Crimes Commission (EFCC) were convinced abinitio of the importance of training and research when they conceived the idea of a Training and Research Institute in 2005. Apart from building the Commissionâ€™s work force of crack operatives, the Institute has been saddled with the responsibility of ensuring fifteen percent (15%) of every operativeâ€™s time is devoted to training.\r\n\r\nAll human enterprises that produce enduring results run around a robust philosophy. The training philosophy of the TRI is fulcrummed around these core values mainly:\r\n\r\n* Integrity\r\n* Courage\r\n* Professionalism\r\n\r\nBuilding these values into the sub-conscious minds of our operatives has been pursued through a gamut of training traditions, distilled and expressed as the Student Centered Problem Solving (SCPS) methodology. This methodology is itself derived from other training philosophies, ranging from Existentialism, Phenomenology; Ethnomethodology to good old African Pragmatism. Crime is basically a human activity. Like other human activity crime is situated within the context of human relationships. In our methodology, be it for investigating financial crimes like money laundering or Advanced Fee Fraud, we seek to situate the actors within the context of the relationships and linkages that they build. The key to solving crime lies in unlocking the dynamics of these human relationships. We imbue our operatives with the philosophy that crime solving lies in finding out the ways everyday relations serve criminal enterprises.\r\n\r\nGod helping us, we look forward to a great year!     \r\n', NULL, NULL, 'Completed', 1, NULL, NULL, NULL, 1),
(3, 'Police Pension Scandal', NULL, NULL, NULL, NULL, NULL, '2012-01-12', 'This just sets up the target directory for the images to be stored in, and also the exact filename of the new image.\r\nNow that we know where itâ€™s going to go to, we use the move_uploaded_file PHP function to move the file from its temporary location into the newly specified home.\r\n\r\nif(move_uploaded_file($_FILES[\'user_image\'][\'tmp_name\'], $upload_image)) \r\n{\r\n	// Successful moveâ€¦now do the image manipulation\r\n}\r\nelse\r\n{\r\n	// There was a problem with the file and it wasn\'t moved to the server.\r\n?>\r\n	<p>Error processing file.  It may be too large.</p>\r\n	<?php\r\n}', NULL, NULL, 'Ongoing', 1, NULL, NULL, NULL, 1),
(4, 'National Sports Saga', NULL, NULL, NULL, NULL, NULL, '2012-03-02', 'Below is the HTML form code. It\'s pretty simple, we have text box for name, email and url plus a textarea to hold the message. The submit button is attached with a javascript function because we want to check the input values before the page is submitted.\r\n\r\nExample :guestbook.php\r\nSource code : guestbook.phps, guestbook.txt\r\n\r\n<form method=\"post\" name=\"guestform\">\r\n<table width=\"550\" border=\"0\" cellpadding=\"2\" cellspacing=\"1\">\r\n<tr> \r\n<td width=\"100\">Name *</td> <td> \r\n<input name=\"txtName\" type=\"text\" size=\"30\" maxlength=\"30\"></td>\r\n</tr>\r\n<tr> \r\n<td width=\"100\">Email</td>\r\n<td> \r\n<input name=\"txtEmail\" type=\"text\" size=\"30\" maxlength=\"50\"></td>\r\n</tr>\r\n<tr> \r\n<td width=\"100\">Website URL</td>\r\n<td> \r\n<input name=\"txtUrl\" type=\"text\" value=\"http://\" size=\"30\" maxlength=\"50\"></td>\r\n</tr>\r\n<tr> \r\n<td width=\"100\">Message *</td> <td> \r\n<textarea name=\"mtxMessage\" cols=\"80\" rows=\"5\"></textarea></td>\r\n</tr>\r\n<tr> \r\n<td width=\"100\">&nbsp;</td>\r\n<td> \r\n<input name=\"btnSign\" type=\"submit\" value=\"Sign Guestbook\" onClick=\"return checkForm();\"></td>\r\n</tr>\r\n</table>\r\n</form>\r\n\r\nBelow is the javascript code to check the input form. The checkForm() function is called when the \"Sign Guestbook\" button is clicked.\r\n \r\nThe mandatory fields are name and message so if either is empty we pop an alert box to tell the visitor to enter the name and message. Email is not a mandatory field so we only check if in an email address is entered but we won\'t complain if there\'s none .\r\n\r\n \r\n', NULL, NULL, 'Ongoing', 1, NULL, NULL, NULL, 1),
(5, 'Drama over Petroleum scarcity in Nigeria', NULL, NULL, NULL, NULL, NULL, '2012-09-13', '<p>The version most widely known today is based on the <a href=\"http://en.wikipedia.org/wiki/Brothers_Grimm\" title=\"Brothers Grimm\">Brothers Grimm</a> variant. It is about a girl called Little Red Riding Hood, after the red <a href=\"http://en.wikipedia.org/wiki/Hood_%28headgear%29\" title=\"Hood (headgear)\">hooded</a> <a href=\"http://en.wikipedia.org/wiki/Cape\" title=\"Cape\">cape</a> or <a href=\"http://en.wikipedia.org/wiki/Cloak\" title=\"Cloak\">cloak</a> she wears. <a href=\"http://www.cenbank.org\">The girl walks through </a>the woods to deliver food to her sick grandmother.</p>\r\n\r\n<p>A wolf wants to eat the girl but is afraid to do so in public. He approaches the girl, and she na&iuml;vely tells him where she is going. He suggests the girl pick some flowers, which she does. In the meantime, he goes to the grandmother&#39;s house and gains entry by pretending to be the girl. He swallows the grandmother whole, and waits for the girl, disguised as the grandmother.</p>\r\n\r\n<p>When the girl arrives, she notices he looks very strange to be her grandma. In most retellings, this eventually culminates with Little Red Riding Hood saying, &quot;My, what big teeth you have!&quot;<br />\r\nTo which the wolf replies, &quot;The better to eat you with,&quot; and swallows her whole, too.</p>\r\n\r\n<p>A <a href=\"http://en.wikipedia.org/wiki/Hunter\" title=\"Hunter\">hunter</a>, however, comes to the rescue and cuts the wolf open. Little Red Riding Hood and her grandmother emerge unharmed. They fill the wolf&#39;s body with heavy stones, which drown him when he falls into a well. Other versions of the story have had the grandmother shut in the closet instead of eaten, and some have Little Red Riding Hood saved by the hunter as the wolf advances on her rather than after she is eaten.</p>\r\n\r\n<p>The tale makes the clearest contrast between the safe world of the village and the dangers of the <a href=\"http://en.wikipedia.org/wiki/Enchanted_forest\" title=\"Enchanted forest\">forest</a>, conventional antitheses that are essentially medieval, though no written versions are as old as that.</p>\r\n \r\n\r\n\r\n--------------------------------------------------------------------------------\r\n<p>The version most widely known today is based on the <a href=\"http://en.wikipedia.org/wiki/Brothers_Grimm\" title=\"Brothers Grimm\">Brothers Grimm</a> variant. It is about a girl called Little Red Riding Hood, after the red <a href=\"http://en.wikipedia.org/wiki/Hood_%28headgear%29\" title=\"Hood (headgear)\">hooded</a> <a href=\"http://en.wikipedia.org/wiki/Cape\" title=\"Cape\">cape</a> or <a href=\"http://en.wikipedia.org/wiki/Cloak\" title=\"Cloak\">cloak</a> she wears. <a href=\"http://www.cenbank.org\">The girl walks through </a>the woods to deliver food to her sick grandmother.</p>\r\n\r\n<p>A wolf wants to eat the girl but is afraid to do so in public. He approaches the girl, and she na&iuml;vely tells him where she is going. He suggests the girl pick some flowers, which she does. In the meantime, he goes to the grandmother&#39;s house and gains entry by pretending to be the girl. He swallows the grandmother whole, and waits for the girl, disguised as the grandmother.</p>\r\n\r\n<p>When the girl arrives, she notices he looks very strange to be her grandma. In most retellings, this eventually culminates with Little Red Riding Hood saying, &quot;My, what big teeth you have!&quot;<br />\r\nTo which the wolf replies, &quot;The better to eat you with,&quot; and swallows her whole, too.</p>\r\n\r\n<p>A <a href=\"http://en.wikipedia.org/wiki/Hunter\" title=\"Hunter\">hunter</a>, however, comes to the rescue and cuts the wolf open. Little Red Riding Hood and her grandmother emerge unharmed. They fill the wolf&#39;s body with heavy stones, which drown him when he falls into a well. Other versions of the story have had the grandmother shut in the closet instead of eaten, and some have Little Red Riding Hood saved by the hunter as the wolf advances on her rather than after she is eaten.</p>\r\n\r\n<p>The tale makes the clearest contrast between the safe world of the village and the dangers of the <a href=\"http://en.wikipedia.org/wiki/Enchanted_forest\" title=\"Enchanted forest\">forest</a>, conventional antitheses that are essentially medieval, though no written versions are as old as that.</p>\r\n \r\n\r\n\r\n--------------------------------------------------------------------------------\r\n', NULL, NULL, 'Ongoing', 1, 0, NULL, NULL, 0),
(6, 'Doya da Manja', NULL, NULL, NULL, NULL, NULL, '2012-09-14', '<p>The version most widely known today is based on the <a href=\"http://en.wikipedia.org/wiki/Brothers_Grimm\" title=\"Brothers Grimm\">Brothers Grimm</a> variant. It is about a girl called Little Red Riding Hood, after the red <a href=\"http://en.wikipedia.org/wiki/Hood_%28headgear%29\" title=\"Hood (headgear)\">hooded</a> <a href=\"http://en.wikipedia.org/wiki/Cape\" title=\"Cape\">cape</a> or <a href=\"http://en.wikipedia.org/wiki/Cloak\" title=\"Cloak\">cloak</a> she wears. <a href=\"http://www.cenbank.org\">The girl walks through </a>the woods to deliver food to her sick grandmother.</p>\r\n\r\n<p>A wolf wants to eat the girl but is afraid to do so in public. He approaches the girl, and she na&iuml;vely tells him where she is going. He suggests the girl pick some flowers, which she does. In the meantime, he goes to the grandmother&#39;s house and gains entry by pretending to be the girl. He swallows the grandmother whole, and waits for the girl, disguised as the grandmother.</p>\r\n\r\n<p>When the girl arrives, she notices he looks very strange to be her grandma. In most retellings, this eventually culminates with Little Red Riding Hood saying, &quot;My, what big teeth you have!&quot;<br />\r\nTo which the wolf replies, &quot;The better to eat you with,&quot; and swallows her whole, too.</p>\r\n\r\n<p>A <a href=\"http://en.wikipedia.org/wiki/Hunter\" title=\"Hunter\">hunter</a>, however, comes to the rescue and cuts the wolf open. Little Red Riding Hood and her grandmother emerge unharmed. They fill the wolf&#39;s body with heavy stones, which drown him when he falls into a well. Other versions of the story have had the grandmother shut in the closet instead of eaten, and some have Little Red Riding Hood saved by the hunter as the wolf advances on her rather than after she is eaten.</p>\r\n\r\n<p>The tale makes the clearest contrast between the safe world of the village and the dangers of the <a href=\"http://en.wikipedia.org/wiki/Enchanted_forest\" title=\"Enchanted forest\">forest</a>, conventional antitheses that are essentially medieval, though no written versions are as old as that.</p>\r\n \r\n\r\n\r\n', NULL, NULL, 'Completed', 1, 0, NULL, NULL, 1),
