(12, 'Abubakar Sale Musa', '<p align=\"left\"><br /><br /><br /> <span style=\"font-family: Helvetica; font-size: large;\"><span style=\"font-family: Helvetica; font-size: large;\">Section 2. Introduction and installation</span></span></p>\r\n<p><br /><br /><br /></p>\r\n<p align=\"left\"><br /><br /><br /> <span style=\"font-family: Helvetica; font-size: large;\"><span style=\"font-family: Helvetica; font-size: large;\">The need for dynamic content</span></span></p>\r\n<p><br /><br /><br /></p>\r\n<p align=\"left\"><br /><br /><br /> <span style=\"font-family: Helvetica; font-size: small;\"><span style=\"font-family: Helvetica; font-size: small;\">The Web is no longer static; it\'s dynamic. As the information content of the Web grows,</span></span></p>\r\n<p><br /><br /><br /></p>\r\n<p align=\"left\"><br /><br /><br /> <span style=\"font-family: Helvetica; font-size: small;\"><span style=\"font-family: Helvetica; font-size: small;\">so does the need to make Web sites more dynamic. Think of an e-shop that has 1,000</span></span></p>\r\n<p><br /><br /><br /></p>\r\n<p align=\"left\"><br /><br /><br /> <span style=\"font-family: Helvetica; font-size: small;\"><span style=\"font-family: Helvetica; font-size: small;\">products. The owner has to create 1,000 Web pages (one for each product), and</span></span></p>\r\n<p><br /><br /><br /></p>\r\n<p align=\"left\"><br /><br /><br /> <span style=\"font-family: Helvetica; font-size: small;\"><span style=\"font-family: Helvetica; font-size: small;\">whenever anything changes, the owner has to change all those pages. Ouch!!!</span></span></p>\r\n<p><br /><br /><br /></p>\r\n<p align=\"left\"><br /><br /><br /> <span style=\"font-family: Helvetica; font-size: small;\"><span style=\"font-family: Helvetica; font-size: small;\">Wouldn\'t it be easier to have only one page that created and served the content on the</span></span></p>\r\n<p><br /><br /><br /></p>\r\n<p align=\"left\"><br /><br /><br /> <span style=\"font-family: Hel