(1, 'Peter Odimeli in UK Police custodies', '<p>Peter Odimeli, a member of the reknowned notorius gang, was yesterday reported to be in the custody of UK Federal Police.</p>', '2012-09-03', 'akilu', 1),
(2, 'EFCC Academy Houses NACIWA Secretariat', 'The Network of National Anti-Corruption Institutions in West Africa (NACIWA) was established in 2010 to promote coordination and cooperation among institutions established to combat corruption within the West African region. Towards rejuvenating activities and programmes of the network, this strategy document and its action plan have been developed to cover the period 2015 â€“ 2017 and seek to provide a framework for achieving NACIWAâ€™s goals and objectives. To this end, this strategy document focuses on the following strategic goals to be achieved over the next three years: ratification and implementation of the ECOWAS Protocol; a structured and functional network; regular networking among members of the network; increased capacity building to combat corruption; norm setting and the harmonization of policies by countries within the region; and the implementation of a communication and resource mobilization strategy.\r\n', '2015-08-24', 'akilu', 1);

