('administration', 'We are Growing.Higher and Higher!\r\nThe founding fathers of the Economic and Financial Crimes Commission (EFCC) were convinced abinitio of the importance of training and research when they conceived the idea of a Training and Research Institute in 2005. Apart from building the Commission\'s work force of crack operatives, the Institute has been saddled with the responsibility of ensuring fifteen percent (15%) of every operative\'s time is devoted to training.\r\n\r\nAll human enterprises that produce enduring results run around a robust philosophy. The training philosophy of the TRI is fulcrummed around these core values mainly:', NULL, NULL, NULL, 'The EFCC Academy', NULL, 1),
('contact', '<h2>ICT Development Team</h2>\r\n<h5>(1)	Isah J. Abdullahi</h5>\r\n<p>massihu@yahoo.com<br /> 08134671931; 07037679588</p>\r\n<h5>(2)	Umar, Akilu Yakubu</h5>\r\n<p>ayumar@efccnigeria.org; hiakilu@yahoo.com<br /> 08134671931; 07037679588</p>\r\n<h5>(3)	Aaron Tanrien</h5>\r\n<p>aaron@efccnigeria.org<br /> 08134671931; 07037679588</p>\r\n<h5>(4)	Alex Precious</h5>\r\n<p>aprecious@efccnigeria.org<br /> 08134671931; 07037679588</p>\r\n<h5>(5)	Prince Andrew Querhemberger</h5>\r\n<p>qandrew@efccnigeria.org; <br /> 08134671931; 07037679588                     <br /> <br /></p>', NULL, NULL, 0, 'Contact Us', NULL, 1);
INSERT INTO `tbl_pg_intros` (`pagename`, `intro_text`, `page_pic`, `pic_type`, `pic_size`, `intro_title`, `picname`, `visible`) VALUES
('HOMEPAGE', '<strong>We are  Growing.Higher and Higher!</strong><br />\r\n                      The founding fathers of the  Economic and Financial Crimes Commission (EFCC) were convinced abinitio of the  importance of training and research when they conceived the idea of a Training  and Research Institute in 2005. Apart from building the Commission\'s work force  of crack operatives, the Institute has been saddled with the responsibility of  ensuring fifteen percent (15%) of every operative\'s time is devoted to  training.</p>\r\n                  <p> All human enterprises that  produce enduring results run around a robust philosophy. The training  philosophy of the TRI is fulcrummed around these core values mainly:</p>\r\n                    *Â Integrity<br />\r\n                    *Â Courage<br />\r\n                    *Â Professionalism<br />\r\n                <p>Building these values into the  sub-conscious minds of our operatives has been pursued through a gamut of  training traditions, distilled and expressed as the <strong>Student Centered Problem Solving (SCPS)</strong> methodology. This methodology is itself derived from other training  philosophies, ranging from Existentialism, Phenomenology; Ethnomethodology to  good old African Pragmatism. Crime is basically a human activity. Like other  human activity crime is situated within the context of human relationships. In  our methodology, be it for investigating financial crimes like money laundering  or Advanced Fee Fraud, we seek to situate the actors within the context of the  relationships and linkages that they build. The key to solving crime lies in  unlocking the dynamics of these human relationships. We imbue our operatives  with the philosophy that crime solving lies in finding out the ways everyday  relations serve criminal enterprises.</p>\r\n', , 'Image/JPEG', 405504, 'Welcome to EFCC Academy', NULL, 1);
INSERT INTO `tbl_pg_intros` (`pagename`, `intro_text`, `page_pic`, `pic_type`, `pic_size`, `intro_title`, `picname`, `visible`) VALUES
('RESEARCH', '<strong>Research and Development </strong><br />\r\n                      \r\n                  <p> The research component of the Academy liaises with the Training Section to development</p>\r\n                    *&nbsp;Integrity<br />\r\n                    *&nbsp;Courage<br />\r\n                    *&nbsp;Professionalism<br />\r\n                <p>Building these values into the  sub-conscious minds of our operatives has been pursued through a gamut of  training traditions, distilled and expressed as the <strong>Student Centered Problem Solving (SCPS)</strong> methodology. This methodology is itself derived from other training  philosophies, ranging from Existentialism, Phenomenology; Ethnomethodology to  good old African Pragmatism. Crime is basically a human activity. Like other  human activity crime is situated within the context of human relationships. In  our methodology, be it for investigating financial crimes like money laundering  or Advanced Fee Fraud, we seek to situate the actors within the context of the  relationships and linkages that they build. The key to solving crime lies in  unlocking the dynamics of these human relationships. We imbue our operatives  with the philosophy that crime solving lies in finding out the ways everyday  relations serve criminal enterprises.</p>\r\n', NULL, NULL, NULL, 'Research and Development', NULL, 1),
('TRAINING', '<strong>Training and Career Development </strong><br />\r\n                      \r\n                  <p> Training is a critical component of the Academy and the Commission in general</p>\r\n                    *&nbsp;Integrity<br />\r\n                    *&nbsp;Courage<br />\r\n                    *&nbsp;Professionalism<br />\r\n                <p>Building these values into the  sub-conscious minds of our operatives has been pursued through a gamut of  training traditions, distilled and expressed as the <strong>Student Centered Problem Solving (SCPS)</strong> methodology. This methodology is itself derived from other training  philosophies, ranging from Existentialism, Phenomenology; Ethnomethodology to  good old African Pragmatism. Crime is basically a human activity. Like other  human activity crime is situated within the context of human relationships. In  our methodology, be it for investigating financial crimes like money laundering  or Advanced Fee Fraud, we seek to situate the actors within the context of the  relationships and linkages that they build. The key to solving crime lies in  unlocking the dynamics of these human relationships. We imbue our operatives  with the philosophy that crime solving lies in finding out the ways everyday  relations serve criminal enterprises.</p>\r\n', NULL, NULL, NULL, 'Training and Career Development', NULL, 1);

